import React, { PureComponent } from 'react';
import '@vkontakte/vkui/dist/vkui.css';
import '../css/App.css';

export class CardElements extends PureComponent {

    render() {
        const light = { backgroundColor: '#ffffff' };
        const dark = { backgroundColor: '#454647' };
        let scheme = document.body.attributes.getNamedItem('scheme').value;
        return (
            <div className={ "card-elements-container" } style={ scheme === 'space_gray' ? dark : light }>
                {this.props.children}
            </div>
        )
    }

}
